import React, { useState } from 'react';

const IntakeForm: React.FC = () => {
  const [formData, setFormData] = useState<{
    fullName: string;
    dateOfBirth: string;
    gender: string;
    email: string;
    phone: string;
    countryOfOrigin: string;
    dateOfArrival: string;
    immigrationStatus: string;
    supportNeeds: {
      employment: boolean;
      housing: boolean;
      education: boolean;
      languageClasses: boolean;
      other: string;
    };
    emergencyContact: {
      name: string;
      relationship: string;
      phone: string;
      email: string;
    };
    additionalNotes: string;
  }>({
    fullName: '',
    dateOfBirth: '',
    gender: '',
    email: '',
    phone: '',
    countryOfOrigin: '',
    dateOfArrival: '',
    immigrationStatus: '',
    supportNeeds: {
      employment: false,
      housing: false,
      education: false,
      languageClasses: false,
      other: '',
    },
    emergencyContact: {
      name: '',
      relationship: '',
      phone: '',
      email: '',
    },
    additionalNotes: '',
  });

  const handleChange = (e: React.ChangeEvent<HTMLInputElement | HTMLTextAreaElement>) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleCheckboxChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    const { name, checked } = e.target;
    setFormData((prev) => ({
      ...prev,
      supportNeeds: {
        ...prev.supportNeeds,
        [name]: checked,
      },
    }));
  };

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    console.log('Form submitted:', formData);
    // Add submission logic here
  };

  return (
    <form onSubmit={handleSubmit} className="space-y-6 max-w-3xl mx-auto bg-white p-8 shadow-lg rounded-lg">
      <h2 className="text-2xl font-bold text-indigo-900 mb-6">Intake Form</h2>
      {/* Add form fields */}
      <button
        type="submit"
        className="w-full bg-primary text-white py-3 px-4 rounded-lg shadow-lg hover:bg-indigo-700 transition"
      >
        Submit
      </button>
    </form>
  );
};

export default IntakeForm;
